import { Link } from "react-router-dom";
import EventDetailPage from "./EventDetailPage";

const Dummy_Event = [
    {id: 1, title: 'Dummy1'},
    {id: 2, title: 'Dummy2'},
    {id: 3, title: 'Dummy3'},
    {id: 4, title: 'Dummy4'},
]



function EventPage (){
    return(
        <>
        <h1>EventPage</h1>
        <ul>
        {Dummy_Event.map((prod) => (
            <li key={prod.id}>
                <Link to={`/events/${prod.id}`}>{prod.title}</Link>
            </li>
        ))}
        </ul>
        </>
    )
}

export default EventPage;
